    mask : {
        init: function(){       
            
            $('input.fone').length && oFnde.mask.phone($('input.fone'));
            
            $('input.cpf').setMask('cpf');
            $('input.cnpj').setMask('cnpj');      
            $('input.cep').setMask('cep');
            
            oFnde.date.init($("input.date"));

            $('input.cep').setMask('cep');
            $('input.inteiro').setMask({
                mask:'9', 
                type:'repeat'
            });
	
            $('input.decimal').setMask('decimal');
            $('input.signed-decimal').setMask('signed-decimal');
            $('input.decimal6').setMask({
                mask : '99,999',
                type : 'reverse',
                defaultValue : '000'
            });
            $('input.decimal10').setMask({
                mask : '99,999.999',
                type : 'reverse',
                defaultValue : '000'
            });
        
        
            $('input.decimal4d').setMask({
                mask : '9999,999.999.999',
                type : 'reverse',
                defaultValue : '00000'
            }).blur(function(){
                var $obj = $(this)

                for(i=0;i<2;i++){
                    if($obj.val()[$obj.val().length -1] == 0){
                        $obj.val($obj.val().substring(0,$obj.val().length -1))
                    }
                }
            });
	
            //Valor decimal negativo: altera a class
            $('.signed-decimal').keyup(function(){
                ($('.signed-decimal').val().indexOf('-') != -1)? $('.signed-decimal').addClass('formatValorNegativo') : $('.signed-decimal').removeClass('formatValorNegativo');
            });
            if($('.signed-decimal').val()){
                ($('.signed-decimal').val().indexOf('-') != -1)? $('.signed-decimal').addClass('formatValorNegativo') : $('.signed-decimal').removeClass('formatValorNegativo');
            };
    
            $('input.time').setMask({
                mask : '29:59:59',
                autoTab: false,
                setSize: true
            });
	
            //Todo: verificar se deve ficar aqui
            $('.date').bind('change',function(e){
                if(e.keyCode == 13){
                    return false;
                };
                if($(this).val() != ''){
                    if(!Helper.Date.validate($(this).val())){
                        $this = $(this);
                        $(this).val('');
                        Dialog.alert('Data invlida','Ateno',function(){
                            $this.focus();
                        });
                    };
                };
                return false;
            }).bind('click',function(){
                $(this).trigger('change');
            }).bind('blur',function(){
                $(this).trigger('change');
            }).bind('keydown',function(e){
                return !(e.keyCode == 13);
            });
        },

        phone: function($element){
            var validation = function(){
                phone = $element.val().replace(/\D/g, '');
                $element.unsetMask();

                if(phone.length > 10) {
                    $element.setMask({
                        mask: "(99) 99999-9999", 
                        onValid: validation
                    });
                } else {
                    $element.setMask({
                        mask: "(99) 9999-99999", 
                        onValid: validation
                    });
                }
            }
            
            $element.setMask({ 
                mask: $element.val().replace(/\D/g, '').length > 10 ? "(99) 99999-9999" : "(99) 9999-99999",
                autoTab : false,
                onValid: validation
            }).blur(validation)
        }
    }

